script: |
  super -f text -I q7.spq | sort > q7.out

inputs:
  - name: q7.spq
    data: |
      SELECT 50 AS col0 FROM tab1 (FORMAT parquet) WHERE col1 * 72 + - + 27 * - col1 NOT BETWEEN + + 81 + + - col1 / 83 AND - col2;
  - name: tab1

outputs:
  - name: q7.out
    data: |
      50
      50
      50
